import React from 'react';
import logo from '../logo.svg';
import '../App.css';

import {BrowserRouter, Rote, Link} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <BrowserRouter>
          <div>
            <li>
              <Link to="/">Home</Link>
            </li>
          </div>

        </BrowserRouter>

      </header>
    </div>
  );
}

export default App;
